issue.body:
Hi,

is it intended that bg-primary in Sandstone v4 differs from all other primary colors? In v5 it is defined as expected.
There are 2 definitions of bg-primary, obviously the first one is overridden.

#6794 - dark blue, expected color
.bg-primary {
  background-color: #325d88 !important;
}

#10341 - dark gray, don't know why this overrides the first definition
.bg-primary {
  background-color: #3e3f3a !important;
}

KR,
Gerhard

I have a minor request to add the color-scheme value to :root. This allows the browser to know to make the scroll bar dark and other related effects.

So on all dark themes you'd just have to add:

:root {
    color-scheme: dark;
}

and for light themes you'd add

:root {
    color-scheme: light;
}

I would be happy to open a PR with this change if you're okay with it.

