v5.2.0 Sketchy makes radio buttons and checkboxes unfocusable/untabbable, causing tabbing to skip these elements entirely. This issue is present on the [example page](https://bootswatch.com/sketchy/); try tabbing to Checkbox 1/2/3 and Radio 1/2/3. No other themes (including default bootstrap) have this issue.

I've been patching Sketchy with
```css
.btn-check {
    display: inline-block;
    opacity: 0;
}
```
which overrides the Sketchy-specific style
https://github.com/thomaspark/bootswatch/blob/d982c0baf3e425df284cbefa1a12620d6fbaf6e0/dist/sketchy/_bootswatch.scss#L61-L63

This is in the **materia** theme:
```css
.tag {
  padding: 4px 6px;
}
```
And I can't find that class in BS anywhere and it makes e.g. prismjs render bad. I believe `.tag` was a temp name in BS5 (now called badges).

comment.body:
Hey @mybooc, this is caused by `backdrop-filter` being applied to `.accordion-item` in Quartz, creating a new stacking context.

A workaround for you could be something like:
```css
.accordion-item:first-child {
  position: relative;
  z-index: 5;
}
```

Hi @PurpleFox32,

To remove the background gradient:
```css
body {
  background-image: none;
}
```

To make it fixed:
```css
body {
   background-attachment: fixed;
}
```

